import React from "react";
import Card from "react-bootstrap/Card";

// TODO: Find a better way to do this...
import { ReactComponent as Line_1 } from "./line_icons/1.svg";
import { ReactComponent as Line_2 } from "./line_icons/2.svg";
import { ReactComponent as Line_3 } from "./line_icons/3.svg";
import { ReactComponent as Line_4 } from "./line_icons/4.svg";
import { ReactComponent as Line_5 } from "./line_icons/5.svg";
import { ReactComponent as Line_6 } from "./line_icons/6.svg";
import { ReactComponent as Line_7 } from "./line_icons/7.svg";
import { ReactComponent as Line_a } from "./line_icons/a.svg";
import { ReactComponent as Line_b } from "./b.svg";
import { ReactComponent as Line_c } from "./c.svg";
import { ReactComponent as Line_d } from "./d.svg";
import { ReactComponent as Line_e } from "./e.svg";
import { ReactComponent as Line_f } from "./f.svg";
import { ReactComponent as Line_g } from "./g.svg";
import { ReactComponent as Line_h } from "./h.svg";
import { ReactComponent as Line_j } from "./j.svg";
import { ReactComponent as Line_l } from "./l.svg";
import { ReactComponent as Line_m } from "./m.svg";
import { ReactComponent as Line_n } from "./n.svg";
import { ReactComponent as Line_q } from "./q.svg";
import { ReactComponent as Line_r } from "./r.svg";
import { ReactComponent as Line_s } from "./s.svg";
import { ReactComponent as Line_t } from "./t.svg";
import { ReactComponent as Line_w } from "./w.svg";
import { ReactComponent as Line_z } from "./z.svg";

const mapping = {
  1: Line_1,
  2: Line_2,
  3: Line_3,
  4: Line_4,
  5: Line_5,
  6: Line_6,
  7: Line_7,
};

const LineCard = (props) => {
  const Icon = mapping[props.line.toLowerCase()];
  return (
    <Card className="cardWrapper">
      <Card.Body>
        <Card.Title className="lineTitle">
          <Icon height="25" width="25" />
        </Card.Title>
        <Card.Subtitle className="mb-2 text-muted">Downtown</Card.Subtitle>
        <Card.Text>2 min</Card.Text>
        <Card.Subtitle className="mb-2 text-muted">Uptown</Card.Subtitle>
        <Card.Text>4 min</Card.Text>
      </Card.Body>
    </Card>
  );
};

export default LineCard;
